import { Component } from '@angular/core';

interface Option {
  label: string;
  value: boolean;
}

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  options: Option[] = [
    { label: 'Yes', value: true },
    { label: 'No', value: false },
    { label: 'Not sure', value: null }
  ];

  agreeCount = 0;
  disagreeCount = 0;

  onVote(value: boolean) {
    if (value === true) {
      this.agreeCount++;
    } else if (value === false) {
      this.disagreeCount++;
    }
  }
}

<div>
  <h1>Should mankind colonize the Universe?</h1>
  <app-mr-iq (vote)="onVote($event)"></app-mr-iq>
  <app-ms-universe (vote)="onVote($event)"></app-ms-universe>
  <app-bombasto (vote)="onVote($event)"></app-bombasto>
  <app-vote-result [agreeCount]="agreeCount" [disagreeCount]="disagreeCount"></app-vote-result>
</div>
